description:
Grace Under Pressure Tour is a concert released on videocassette, laserdisc, and DVD by the Canadian band Rush. It documents a live concert performance by the band on their 1984 tour in support of the studio album Grace Under Pressure.

In 2006, a DVD version of the original production, with its audio re-mastered in 5.1-channel Dolby Surround by Rush guitarist and co-producer Alex Lifeson, was released as part of the DVD box set, titled Rush Replay X 3. In 2007, the DVD version of Grace Under Pressure Tour, as it was included in Replay X 3, was released as a single, stand-alone DVD. As a special feature, Rush Replay x 3 includes an audio CD of Grace Under Pressure Tour DVD that was unavailable elsewhere until a stand-alone CD release in 2009.

